import React, { Component } from 'react';
import './App.css';
import Markdown from 'markdown-to-jsx';
import README from './README.md'

class App extends Component {
  constructor(props) {
    super(props)

    this.state = { md: "" }
  }

  componentWillMount() {
    fetch(README)
      .then((res) => res.text())
      .then((md) => {
        this.setState({ md })
      })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>

          </p>
        </header>
      </div>
    );
  }
}

export default App;
